import React from "react";

function Customization() {
  return (
    <section className="cart-area ptb-60">
      <ToastContainer transition={Slide} />
      <div className="container">
        <div className="row">
          <div className="col-lg-12 col-md-12">
           dadwa
          </div>
        </div>
      </div>
    </section>
  );
}

export default Customization;
